import { Route, Routes } from "react-router-dom";

import './App.css';

import FormRentChapter from "./formRentChapter/FormRentChapter";
import FormAlqCharacter from "./formDeleteCharacter/FormAlqCharacter";
import FormGetChacaters from "./formGetChacaters/FormGetChacaters";

import Layout from './layout/Layout';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/' element={<Layout/>}>
          <Route path="/rent" element={<FormRentChapter/>} />
          <Route path="/alq" element={<FormAlqCharacter/>} />
          <Route path="/list" element={<FormGetChacaters/>} />
        </Route>
      </Routes>
    </div>
  );
}

export default App;
